package com.res.bean;public class ResMenus implements java.io.Serializable {	private static final long serialVersionUID = 1L;	private Integer pkId;	private Integer itemId;	private String itemNo;	private String menuMoney;	private String menuMemo;	private String menuDate;	private Integer menuCreatetime;	private Integer menuAdduser;	public Integer getPkId() {		return pkId;	}	public void setPkId(Integer pkId) {		this.pkId = pkId;	}	public Integer getItemId() {		return itemId;	}	public void setItemId(Integer itemId) {		this.itemId = itemId;	}	public String getItemNo() {		return itemNo;	}	public void setItemNo(String itemNo) {		this.itemNo = itemNo;	}	public String getMenuMoney() {		return menuMoney;	}	public void setMenuMoney(String menuMoney) {		this.menuMoney = menuMoney;	}	public String getMenuMemo() {		return menuMemo;	}	public void setMenuMemo(String menuMemo) {		this.menuMemo = menuMemo;	}	public String getMenuDate() {		return menuDate;	}	public void setMenuDate(String menuDate) {		this.menuDate = menuDate;	}	public Integer getMenuCreatetime() {		return menuCreatetime;	}	public void setMenuCreatetime(Integer menuCreatetime) {		this.menuCreatetime = menuCreatetime;	}	public Integer getMenuAdduser() {		return menuAdduser;	}	public void setMenuAdduser(Integer menuAdduser) {		this.menuAdduser = menuAdduser;	}		}